import React from 'react'

function LeaderboardUser({ name, communityId, profilePic, streak }) {
  return (
        <tr>
            <td>Rank</td>
            <td>Member Name</td>
            <td>Profile Pic</td>
            <td>Community Name</td>
        </tr>
  )
}

export default LeaderboardUser
